import React, { useEffect, useState } from "react";
import classNames from "classname";
import './App.css'
import WishInput from "./WishInput";
import WishList from "./WishList";
import Modal from "./components/Modal";

let initialWishes = [
    { done: true, text: 'Travel to the moon' },
    { done: false, text: 'Make an intro course to react' },
    { done: false, text: 'Pay to gym' },
    { done: false, text: 'Go to the gym' }
];

const App = () => {


    const [wishes, setWishes] = useState(initialWishes);

    const [isModalOpen, setIsModalOpen] = useState(false); // Empieza cerrado
    const [isMounted, setIsMounted] = useState(false); // Para controlar si el componente está montado

    const closeModal = () => setIsModalOpen(false);
    const openModal = () => setIsModalOpen(true);

    // Usamos useEffect para asegurarnos de que el DOM esté listo
    useEffect(() => {
      // Al montar el componente, se abre el modal
      setIsMounted(true);
      setIsModalOpen(true); // Abre el modal una vez montado
    }, []); // Solo se ejecuta al montar




    return (<>
        <div className="app">
            <h1>My wishlist</h1>
            <WishInput onNewWish={wish => {
                setWishes([wish, ...wishes])
            }} />
            <WishList wishes={wishes} onWishesChange={setWishes} />
            <button type="button" onClick={() => setWishes(wishes.filter(wish => !wish.done))} className="wish-clear">Archive done</button>
        </div>

        <div className="App">
            <h1>App con Modal reutilizable</h1>
            <button onClick={openModal}>Abrir Modal</button>

            {/* Modal reutilizable */}
            {isMounted && (
                <Modal isOpen={isModalOpen} onClose={closeModal}>
                    <h2>Este es un modal reutilizable</h2>
                    <p>Puedes usar este componente modal en cualquier lugar de la aplicación.</p>
                </Modal>
              )}
        </div>

    </>

    );

}


export default App;
